import React from  'react';

const Puzzle = (props) => {
  // return (
  // <p>I am the puzzle page" </p>
  // )
  if (props.listOfSites.length === 0){
    return (<p>Puzzles loading.....</p>)
  }

  const listOfSites = props.listOfSites.map((puzzle, index) => {
      return (
        <li key={index} className="compnent-item">
        <div className="component">
        <Puzzle puzzle={puzzle}/>
        </div>
        </li>
      )
  })

  return  (
    <ul className="component-list">
    {listOfSites}
    </ul>)

}


export default Puzzle;
